import React from 'react';
import { useQuery } from 'react-query';
import { Users, Star, Calendar, MessageCircle } from 'lucide-react';
import { apiService } from '../services/api';
import { getSubjectColor, getLearningStyleName } from '../utils/helpers';
import LoadingSpinner from '../components/LoadingSpinner';
import toast from 'react-hot-toast';

const MatchesPage = () => {
  const { data: matches, isLoading, refetch } = useQuery('matches', () => 
    apiService.getMatches({ limit: 20 })
  );

  const handleLike = async (matchId) => {
    try {
      await apiService.likeMatch(matchId);
      toast.success('Match updated!');
      refetch();
    } catch (error) {
      toast.error('Failed to update match');
    }
  };

  const handleStartChat = async (userId) => {
    try {
      await apiService.startChat(userId);
      toast.success('Chat started!');
    } catch (error) {
      toast.error('Failed to start chat');
    }
  };

  if (isLoading) {
    return (
      <div className="flex items-center justify-center py-12">
        <LoadingSpinner size="lg" />
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div className="text-center">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Your Study Matches</h1>
        <p className="text-gray-600">Found {matches?.matches?.length || 0} compatible study partners</p>
      </div>

      {matches?.matches?.length === 0 ? (
        <div className="text-center py-12">
          <Users className="w-16 h-16 mx-auto mb-4 text-gray-300" />
          <h3 className="text-lg font-semibold text-gray-900 mb-2">No matches found yet</h3>
          <p className="text-gray-600">Update your profile to find compatible study partners!</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {matches?.matches?.map(match => (
            <div key={match.id} className="card-hover p-6">
              <div className="text-center mb-4">
                <img 
                  src={match.user?.avatar || '/default-avatar.png'} 
                  alt={match.user?.name} 
                  className="w-20 h-20 rounded-full mx-auto mb-3" 
                />
                <h3 className="text-lg font-semibold text-gray-900">{match.user?.name}</h3>
                <div className="flex items-center justify-center gap-1 mb-2">
                  <div className="text-2xl font-bold text-primary-600">{match.compatibility}%</div>
                  <div className="text-sm text-gray-500">match</div>
                </div>
              </div>

              <div className="space-y-3 mb-6">
                <div>
                  <div className="text-sm font-medium text-gray-700 mb-1">Subjects</div>
                  <div className="flex flex-wrap gap-1">
                    {match.user?.profile?.subjects?.slice(0, 3).map(subject => (
                      <span key={subject} className={`badge ${getSubjectColor(subject)}`}>
                        {subject}
                      </span>
                    ))}
                  </div>
                </div>

                <div>
                  <div className="text-sm font-medium text-gray-700 mb-1">Learning Style</div>
                  <div className="text-sm text-gray-600">
                    {getLearningStyleName(match.user?.profile?.learningStyle)}
                  </div>
                </div>

                <div>
                  <div className="text-sm font-medium text-gray-700 mb-1">Performance Level</div>
                  <div className="flex">
                    {[1, 2, 3, 4, 5].map(level => (
                      <Star
                        key={level}
                        className={`w-4 h-4 ${
                          level <= (match.user?.profile?.performanceLevel || 0)
                            ? 'text-yellow-400 fill-current'
                            : 'text-gray-300'
                        }`}
                      />
                    ))}
                  </div>
                </div>

                {match.user?.profile?.goals && (
                  <div>
                    <div className="text-sm font-medium text-gray-700 mb-1">Goals</div>
                    <div className="text-sm text-gray-600">{match.user.profile.goals}</div>
                  </div>
                )}
              </div>

              <div className="flex gap-2">
                <button
                  onClick={() => handleLike(match.id)}
                  className="flex-1 btn-primary flex items-center justify-center gap-2"
                >
                  <Users className="w-4 h-4" />
                  Like
                </button>
                <button 
                  onClick={() => handleStartChat(match.user?.id)}
                  className="flex-1 btn-secondary flex items-center justify-center gap-2"
                >
                  <MessageCircle className="w-4 h-4" />
                  Message
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MatchesPage;
